-- CREAZIONE TABELLA: IMMOBILI
CREATE TABLE IF NOT EXISTS IMMOBILI(
    id INTEGER AUTO_INCREMENT,
    tipologia VARCHAR(255) NOT NULL,
    immagine1 VARCHAR(255) NOT NULL,
    immagine2 VARCHAR(255) NOT NULL,
    immagine3 VARCHAR(255) NOT NULL,
    immagine4 VARCHAR(255) NOT NULL,
    immagine5 VARCHAR(255) NOT NULL,
    immagine6 VARCHAR(255) NOT NULL,
    immagine7 VARCHAR(255) NOT NULL,
    immagine8 VARCHAR(255) NOT NULL, 
    immagine9 VARCHAR(255) NOT NULL, 
    alt VARCHAR(255) NOT NULL,
    amato_dagli_ospiti TINYINT(1) NOT NULL DEFAULT 0,
    luogo VARCHAR(255) NOT NULL,
    tipologia_host VARCHAR(255) NOT NULL,
    intervallo_date VARCHAR(255) NOT NULL,
    prezzo INTEGER NOT NULL,
    PRIMARY KEY(id)
) Engine = 'InnoDB';

